<script>
import unidades from "../data/unidades.json";
import comandos from "../data/comandos.json";
import cidades from "../data/cidades.json";
export default {
    data() {
        return {
            unidades: unidades.unidades,
            comandos: comandos.comandos,
            cidades: cidades.cidades,
            city: ''
        }
    },

    mounted() {
        //console.log(this.unidades);
        //console.log(this.comandos);
        //console.log(this.cidades);
    },

    methods: {
        getColor(city) {
            city = city.replace(/\D/g, '');
            let cidade = this.getCity(city);

            if (!cidade) return '#000000';

            if (!cidade.comando_id) return '#000000';

            let comando = this.getComando(cidade.comando_id);
            return comando.color;
        },
        getUnidade(city) {
            return this.unidades.find(unidade => unidade.cidade_id == city);
        },
        getComando(id) {
            return this.comandos.find(comando => comando.id === id);
        },
        getCity(id) {
            return this.cidades.find(cidade => cidade.co_ibge == id);
        },
        showTooltip(event) {
            const link = event.target.parentNode;
            const tooltipText = link.getAttribute('data-name');
            this.city = tooltipText;
            tooltipContainer.style.display = 'flex';
            tooltipContainer.style.top = event.clientY + 'px';
            tooltipContainer.style.left = event.clientX + 'px';
        },
        hideTooltip() {
            const tooltipContainer = document.getElementById('tooltipContainer');
            tooltipContainer.style.display = 'none';
        }
    }

}
</script>